  false,\n\t\"url\": null,\n\t\"notes\": \"This metadata is for the vegetation and
  land-use geo-spatial database for Sunset Crater Volcano National Monument and surrounding
  areas. The project is authorized as part of the USGS/NPS Vegetation Mapping Program.
  The program is being administered by the Biological Resources Discipline (BRD),
  United States Geological Survey (USGS). The USGS/BRD is responsible for overall
  management and oversight of all ongoing mapping efforts. This mapping effort was
  performed by the US Bureau of Reclamation's (USBR) Remote Sensing and GIS Group,
  Technical Service Center, Denver, CO and the USGS Colorado Plateau Research Station,
  Flagstaff, AZ. The vegetation mapping program is part of a larger Inventory and
  Monitoring (I&M) program started by the National Park Service (NPS).\",\n\t\"license_title\":
